import React from 'react';

export default function Search() {
  return (
    <div className='d-flex' style={{ width: '35%' }}>
      <form action='' className='container-fluid bg-white'>
        <div className='input-group d-inline-flex w-100'>
          <input
            type='text'
            placeholder='Search for products, brands and more'
            className='form-control input-group-text rounded-0 bg-white border-0 h2'
          />
          <button className='input-group-text rounded-0 bg-white border-0'>
            <i className='fa-solid fa-magnifying-glass border-0' />
          </button>
        </div>
      </form>
    </div>
  );
}
